import React from 'react';



interface IProps{
msg:string;
}
interface IState{
msg:string;
}
class Welcome extends React.Component<IProps,IState>
{
    constructor(props:IProps)
    {
        super(props);
        this.state={
            msg:"Welcome to destiny"
        }
    }
    render()
    {
        return(
            <React.Fragment>
            <h2>{this.props.msg}</h2>
            <h1>{this.state.msg}</h1>
            </React.Fragment>
        );
    }
}

export default Welcome;
